Sure! Here's a simple HTML and CSS structure for a landing page for a dog petting café. You can customize the text, images, and styles to fit your brand.

### HTML (index.html)

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Furry Friends Café</title>
    <link rel="stylesheet" href="styles.css">
</head>
<body>
    <header>
        <div class="container">
            <h1>Welcome to Furry Friends Café</h1>
            <p>Your cozy spot for dog petting and delicious treats!</p>
        </div>
    </header>

    <main>
        <section class="about">
            <h2>About Us</h2>
            <p>At Furry Friends Café, we celebrate the joy of dogs! Enjoy cuddles with our friendly pups while sipping on your favorite coffee.</p>
        </section>

        <section class="menu">
            <h2>Menu</h2>
            <ul>
                <li>Coffee</li>
                <li>Tea</li>
                <li>Pastries</li>
                <li>Dog Treats</li>
            </ul>
        </section>

        <section class="gallery">
            <h2>Gallery</h2>
            <img src="dog1.jpg" alt="Happy dog">
            <img src="dog2.jpg" alt="Pup playing">
            <img src="dog3.jpg" alt="Café interior">
        </section>

        <section class="contact">
            <h2>Contact Us</h2>
            <p>Email: info@furryfriendscafe.com</p>
            <p>Phone: (555) 123-4567</p>
            <p>Visit us at: 123 Bark Street, Dogtown</p>
        </section>
    </main>

    <footer>
        <p>&copy; 2023 Furry Friends Café. All Rights Reserved.</p>
        <p>Follow us on social media!</p>
    </footer>
</body>
</html>
```

### CSS (styles.css)

```css
body {
    font-family: Arial, sans-serif;
    margin: 0;
    padding: 0;
    background-color: #f5f5f5;
}

header {
    background-color: #ffcc00;
    padding: 20px;
    text-align: center;
}

h1 {
    margin: 0;
    font-size: 2.5em;
}

main {
    padding: 20px;
    max-width: 800px;
    margin: auto;
}

.about, .menu, .gallery, .contact {
    margin-bottom: 30px;
    background-color: #fff;
    padding: 20px;
    border-radius: 5px;
    box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
}

h2 {
    font-size: 2em;
    margin-bottom: 10px;
}

.gallery img {
    max-width: 100%;
    height: auto;
    margin: 5px;
}

footer {
    text-align: center;
    padding: 10px;
    background-color: #232323;
    color: white;
    position: relative;
    bottom: 0;
    width: 100%;
}
```

### Instructions to Set Up

1. **Create Two Files**: Create `index.html` and `styles.css` in the same directory.

2. **Images**: Replace the `src` attributes in the `<img>` tags within the gallery section with the actual image paths for your dog images.

3. **Customize Content**: Feel free to modify text and styling to match your desired aesthetic.

4. **Open in Browser**: Open `index.html` in a web browser to see your landing page in action!

This simple landing page can serve as a great starting point for your dog petting café!

